import React from 'react';
import './App.css';
import { Login1 } from './Paginas/Login1/Login1';

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";


function App() {
  return (
    <Router>
      <Switch>
          <Route exact path="/" component={Login1}/>
          <Route path="/login" component={LoginUser}/>

          <Route path="*">
            <h1>Not Found</h1>
          </Route>
      </Switch>
    </Router>
  );
}

function LoginUser() {
  return (
    <Switch>
      <Route exact path="/login/estudiante">
        <h1>ESTUDIANTE</h1>
      </Route>
      <Route exact path="/login/empresa">
        <h1>EMPRESA</h1>
      </Route>
      <Route exact path="/login/admin">
        <h1>ADMINISTRADOR</h1>
      </Route>
    </Switch>
  )
}
export default App;
